import { createMuiTheme } from "@material-ui/core/styles";

export const theme = createMuiTheme({
  palette: {
    secondary: {
      main: "#5f0937",
    },
  },

  typography: {
    h5: {
      fontWeight: 900,
      letterSpacing: "0.09em",
      fontSize: "1.3rem",
      
    },
  },
});
